import { FaGithub } from "react-icons/fa";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="navbar mb-12 shadow-lg bg-secondary-content text-primary-content">
      Navbar
    </nav>
  );
}

Navbar.defaultProps = {
  title: "Github Finder",
};

Navbar.protoTypes = {
  title: PropTypes.string,
};

export default Navbar;
